import React from 'react'
import TodoImg from '../images/TodoImg.png';

const MyTodo = () => {
  return (
    <div className='mybox'>
      <div className='box1'>
        <img src={TodoImg} alt='todo app' title='todo app'/>
      </div>
      <div className='box2'>
        <h2></h2>
      </div>
      <div className='box3'>3</div>

    </div>
  )
}

export default MyTodo
